const ChefItem = ({ chef }) => {
  const arr = [];
  if (chef.chefName === "Yossi Shitrit") {
    arr.push({ name: chef.restaurantName, img: chef.restaurantImage });
  }
  console.log(arr);
  return (
    <div>
      {arr.map((chef) => {
        <div className="chef-restaurant-item">
          <img
            src={chef.restaurantImage}
            alt="img"
            className="chef-restaurant-img"
          />{" "}
          <h3>{chef.restaurantName}</h3>
        </div>;
      })}
      ;
    </div>
  );
};

export default ChefItem;
